import React from 'react';
import '../styles/styles.css';

const JobCard = ({ title, date, time, description, imageUrl }) => {
  return (
    <div className="single_courses">
      <div className="single_courses_thumb">
        <img src={imageUrl} alt="Job" width="100%" />
      </div>
      <div className="single_courses_desc">
        <div className="title">
          <a href="#">
            <h5>{title}</h5>
          </a>
          <div className="date_time">
            <div className="date">
              <p>
                <span className="icon-calendar"></span> {date}
              </p>
            </div>
            <div className="time">
              <p>
                <span className="icon-clock"></span> {time}
              </p>
            </div>
          </div>
          <p>{description}</p>
        </div>
      </div>
    </div>
  );
};

const JobList = () => {
  const jobs = [
    {
      title: 'Software Engineer',
      date: '2023-05-20',
      time: '', // Remove time if not applicable
      description: 'Lorem ipsum dolor sit amet...',
      imageUrl: 'https://via.placeholder.com/150', // Placeholder image
    },
    {
      title: 'Data Analyst',
      date: '2023-05-20',
      time: '', // Remove time if not applicable
      description: 'Lorem ipsum dolor sit amet...',
      imageUrl: 'https://via.placeholder.com/150', // Placeholder image
    },
    {
      title: 'Marketing Manager',
      date: '2023-05-20',
      time: '', // Remove time if not applicable
      description: 'Lorem ipsum dolor sit amet...',
      imageUrl: 'https://via.placeholder.com/150', // Placeholder image
    },
    // Add more job objects here
  ];

  return (
    <section className="demo">
      <div className="container">
        <div id="owl-example" className="owl-carousel">
          {jobs.map((job) => (
            <JobCard key={job.title} {...job} />
          ))}
          <script src="https://code.jquery.com/jquery-3.6.0.min.js"></script>
        </div>
      </div>
    </section>
  );
};
export default JobList;
